body{
    text-align: center;
    font-size: 15px;
    padding: 1%;
    font-family: Avenir;
}

.title-fade-out{
    opacity: 0;
    animation-name: fade-out;
    animation-duration: 2s;
}

.title-fade-in{
    opacity: 100;
    animation-name: fade-in;
    animation-duration: 2s;
}

@keyframes fade-out{
    from {opacity:100}
    to {opacity: 0}
}

@keyframes fade-in{
    from {opacity:0}
    to {opacity: 100}
}
